import React from "react";
import "../App";
import MrBriCool from "../images/icons/MrBriCool.svg";
const NavBarTop = () => {
  return (
    <header>
      <nav className="bg-blue-200 flex space-x-64">
        <div className="flex space-x-4">
          <img className="ml-5 w-40" src={MrBriCool} alt="logo" />
          <a href="/" className="mt-4 text-blue-900 font-bold hover:underline">
            Devenir MrBriCool
          </a>
        </div>
        <div className="flex justify-center">
          <a
            href="/"
            className="text-white font-bold text-center mt-2 bg-blue-500 hover:bg-blue-800 focus:ring-4 focus:ring-blue-300 rounded-3xl w-72 text-sm px-5 py-2.5 mr-2 mb-2 focus:outline-none dark:focus:ring-blue-800"
          >
            Trouver un Bricoleur
          </a>
        </div>
        <div className="flex space-x-4">
          <a
            href="/"
            className="text-white font-bold text-center mt-2 bg-white hover:bg-none,  focus:ring-4 focus:ring-blue-300 rounded-3xl w-24 text-sm px-5 py-2.5 mr-2 mb-2 focus:outline-none dark:focus:ring-blue-800"
          >
            
          </a>
        </div>
      </nav>
    </header>
  );
};

export default NavBarTop;
